            // Ajouter des tooltips  tous les marqueurs
            (function() {
                var map = map_5923c6deb6a8f316f1b9ebf65bfdf48d;
                var markers = [];
                
                // Collecter tous les marqueurs de la carte
                map.eachLayer(function(layer) {
                    if (layer instanceof L.CircleMarker) {
                        markers.push(layer);
                    }
                });
                
                // Ajouter des tooltips bass sur la couleur et les coordonnes
                markers.forEach(function(marker) {
                    var lat = marker.getLatLng().lat;
                    var lng = marker.getLatLng().lng;
                    var color = marker.options.color || 'blue';
                    
                    // Dterminer le type de zone selon la couleur
                    var zoneType = '';
                    if (color === 'red') {
                        zoneType = 'Zone mal desservie';
                    } else if (color === 'green') {
                        zoneType = 'Zone bien desservie';
                    } else {
                        zoneType = 'Commune';
                    }
                    
                    // Crer le texte du tooltip
                    var tooltipText = '<b>' + zoneType + '</b><br>Lat: ' + lat.toFixed(4) + '<br>Lng: ' + lng.toFixed(4);
                    
                    // Ajouter le tooltip
                    marker.bindTooltip(tooltipText, {
                        permanent: false,
                        direction: 'top',
                        offset: [0, -10]
                    });
                    
                    // Ajouter aussi un popup au clic
                    var popupText = '<div style="min-width: 150px;"><b>' + zoneType + '</b><br>' +
                        'Coordonnes:<br>Latitude: ' + lat.toFixed(6) + '<br>Longitude: ' + lng.toFixed(6) + '</div>';
                    marker.bindPopup(popupText);
                });
                
                console.log('Tooltips ajouts  ' + markers.length + ' marqueurs');
            })();
